import "./Nav.css";

function Nav() {
  const [isMenuActive, setIsMenuActive] = useState(false);

  return (
    <nav>
      <MenuIcon />
    </nav>
  );
}

function MenuIcon() {
  return (
    <div className="nav__menu-icon">
      <span className="nav__menu-icon--top"></span>
      <span className="nav__menu-icon--mid"></span>
      <span className="nav__menu-icon--bot"></span>
    </div>
  );
}

export default Nav;
